import React, {useState} from 'react';
import { StyleSheet, View, Text} from 'react-native';

import ItemCardapio from './ItemCardapio';

const Cardapio1 = (props)=> {
  const [amountCardapio,setAmountCardapio] = useState(0)

  return (
    <View>
      <ItemCardapio
        titulo="Hamburguer"
        imagem="hamburguer_batata"
        descricao="Promoção de Hambúruguer + Batata"
        preco="20"
        amount={amountCardapio}
        handler={setAmountCardapio}
      />
    </View>
  );
}

export default Cardapio1
